import { Box, Typography, List, Link } from '@mui/material'
import React from 'react'
import { ProjectLayout, AboutMeLayout } from './Layout'
import yycodrImage from '../static/yycodr.jpg'

export const Project = () => {
    return (
        <ProjectLayout>
            <Box
                display={'flex'}
                flexDirection={'column'}
                width={'100%'}
            >
                <Typography variant={'h1'} sx={{ marginBottom: 2 }}>Personal Projects</Typography>
                <Box
                    display={'flex'}
                    justifyContent={'space-between'}
                    sx={{
                        mx: 8 
                    }}
                >
                    <img
                        src={yycodrImage}
                        style={{ borderRadius: '2%' }}
                        height={500}
                    />
                    <Box
                    display={'flex'}
                    flexDirection={'column'}
                    >
                        <Box
                            display={'flex'}
                            flexDirection={'column'}
                            sx={{ textAlign: 'end' }}
                        >
                            <Typography variant={'h2'}>Outdoor Rink Locator</Typography>
                            <Link href='https://yyc-odr.ca' target={'_blank'}>yyc-odr.ca</Link>
                        </Box>
                        <Typography variant={'h3'}>A web app for determining the closest outdoor rink to the user's location in Calgary.</Typography>
                    </Box>

                </Box>





            </Box>
        </ProjectLayout>
    )

}
